ON CONFLICT (name) DO NOTHING;

DO $$
DECLARE
    user_record RECORD;
    tag_count INT;
    start_tag INT := 1;
    current_tag INT;
BEGIN
    SELECT COUNT(*) INTO tag_count FROM tags;

    FOR user_record IN SELECT id FROM users LOOP
        IF start_tag + 4 <= tag_count THEN
            FOR current_tag IN start_tag..(start_tag + 4) LOOP
            END LOOP;
            start_tag := start_tag + 1;
        ELSE
            start_tag := 1;
            FOR current_tag IN start_tag..(start_tag + 4) LOOP
            END LOOP;
            start_tag := start_tag + 1;
        END IF;
    END LOOP;
END $$;







